// src/components/NavLink.js
import React from 'react';
import { Link } from 'react-router-dom'; // Importez Link depuis react-router-dom
import styles from './NavLink.module.css'; // Importation du module CSS

const NavLink = () => {
    return (
        <nav className={styles.nav}>
            <h1 className={styles.title}>Walpaper StreamDeck</h1>
            <ul className={styles.menu}>
                <li className={styles.item}>
                    <Link to="/">Home</Link> {/* Lien vers la page d'accueil */}
                </li>
                <li className={styles.item}>
                    <Link to="/mywalpaper">My Walpaper</Link> {/* Lien vers la seconde page */}
                </li>
            </ul>
        </nav>
    );
};

export default NavLink;
